import React from 'react'

const PropertyItem = ({name, image, description, onDeleteClick}) => (
  <div className="card">
    <img className="card-img-top" src={image} alt="name"/>
    <div className="card-title">{name}</div>
  </div>
)

export default PropertyItem;
